import React from 'react'
import { Link } from "react-router-dom";

const AboutContent = () => {
  return (
    <div>
        <h1>
            Who Am I?
        </h1>
        <p>
            My name is Jennifer Cao
        </p>
        <Link></Link>
    </div>
  )
}

export default AboutContent
